import { createStore } from "redux";

const reducer = (state, action) => {
  switch (action.type) {
    case "INC":
      break;
    case "INC":
      break;
    case "INC":
      break;
    case "INC":
      break;
  }
};

const store = createStore(reducer, 0);

store.subscribe(() => {
  console.log("Store Changed: ", store.getState());
});
